import React from "react";

const ImageDetail = ({ image }) => (
  <div>
    <h3>{image.title}</h3>
    <img src={image.url} alt={image.title} style={{ width: "300px" }} />
    <p>{image.description}</p>
  </div>
);

export default ImageDetail;
